"use strict";

var Incoming, // constructor, function
    Message = require(__dirname + "/../Message");

/**
 * @auguments Bender/HttpServer/Message
 * @constructor
 * @param {Date} date
 */
Incoming = function (date) {
    Message.call(this, date);
};
Incoming.prototype = Object.create(Message.prototype);

module.exports = Incoming;
